lax:{name:"Lax",unlock:"Repair Lax's house to unlock",description:"There isn't a thing that Lax won't eat. During his beauty pageant days his skill was eating a bucket of butter on stage. He also has no sense of smell. This would be grand in a room of farts, however it was rather fateful for dear Lax, who ignorantly delved into a two-week old unrefrigerated pie."},dippy:{name:"Dippy",unlock:"Repair Dippy's house to unlock",description:"Dippy is the product of a cloning experiment gone wrong. The hope was to create a super species that could live under water. The result was a witless, water-obesessed creature who dipped his body parts in any liquid. This included his doctor's soup, the toilet and of course, piranha-infested waters. The experiment is closed until further notice."},
dummkopf:{name:"Dummkopf",unlock:"Repair Dummkopf's house to unlock",description:"Dummbkopf was named after his great grandfather, who enjoyed bomb disposal as a hobby. His name is German and roughly translated means someone who puts a fork in a toaster without pulling the plug out first. He is distantly related to Hapless, who also likes to prod dangerous things."},stumble:{name:"Stumble",unlock:"Repair Stumble's house to unlock",description:"Stumble likes listening to dubstep music on his headphones while standing dangerously close to the edge of the platform for his train. The music helps block out the dreary monotony of commuting to work and unfortunately for Stumble - the sound of approaching trains. His favourite song goes like this Boom-ticker-ticker-boom-ticker-ticker boom\u2026ahhhhhhhhh!"},
